import React from "react";
import { Typography, Space, Row, Col, Button } from "antd";
import { useRouter } from "next/router";
const { Text } = Typography;

const Home = () => {
	const router = useRouter();

	const toDog = () => {
		router.push("/dog");
	};

	const toCat = () => {
		router.push("/cat");
	};

	return (
		<>
			<Row justify="center">
				<Col span={12}>
					<Text strong justify="center">
						강아지
					</Text>
				</Col>
				<Col span={12}>
					<Text strong>고양이</Text>
				</Col>
			</Row>

			<Row justify="center">
				<Col span={12}>
					<Button onClick={toDog}>
						<img src="../assets/dog" />
					</Button>
				</Col>
				<Col span={12}>
					<Button onClick={toCat}>화르르</Button>
				</Col>
			</Row>

			<Row justify="center">
				<Col span={12}>
					<Button onClick={toDog}>멍</Button>
				</Col>
				<Col span={12}>
					<Button onClick={toCat}>냥</Button>
				</Col>
			</Row>
		</>
	);
};

export default Home;
